const IMAGE_PATH = '../images/sculptures';

export default (props: {forSale: boolean}) => {
    const {forSale} = props;
    const data = Array(20).fill(test);

    return (
        <div className="sculptures-list-container">
            {data.map(sculpture => <div>{sculpture.name}</div>)}
        </div>
    );
};
